  135deg,           /* ângulo mais dinâmico */
  #f5f9ff 0%,       /* um branco azulado bem suave */
  #3a6ea5 40%,      /* azul médio */
  #002f52 75%,      /* azul marinho */
   #0a0a0a 100%      /* preto quase puro */
);
// background: #000;

// margin: 5px;
padding-top: 20px;
gap: 20px;
`

function Evolves() {
  return (
    <AppContainer>
      <FrameEvolve />
    </AppContainer>
  );
}

export default Evolves;
